import React, { useState } from 'react';
import Task from './Task';
import Status from './Status';

const TaskCard = props => {
  return (
      <tr>
        <Task task={props.task}/>
        <Status status={props.completion} />
        <td>
          {props.task.date}
        </td>
      </tr>
  )
}

export default TaskCard;
